import React, { useState, useCallback } from "react";

import "./Main.css";
import PQForms from "./PQForms";

function Main() {
  const [state, setState] = useState(1);

  const onStateChange = useCallback(
    (x) => {
      setState(x);
    },
    [setState]
  );

  return (
    <main className="main">
      <PQForms onStateChange={onStateChange} />
    </main>
  );
}

export default Main;
